import React, { Component } from 'react';
import { View, Text, FlatList, StyleSheet } from 'react-native';
import pokemon from './pokemonStore'
import * as Application from 'expo-application';
import { UnavailabilityError } from '@unimodules/core';
import * as Segment from 'expo-analytics-segment';
import * as Amplitude from 'expo-analytics-amplitude';
Segment.initialize({
  iosWriteKey: "dvHY8AWKFtchJ5R146WyuAsHy45Tak1F",
  androidWriteKey: "rMtRzfD2wS4dyjQVw0RrWcM4ZRnEAzG9",
})
Segment.track('pageLoad')


Amplitude.initialize('b000c3d0ca796cc59fd71f6935584882')
Amplitude.logEvent('pageLoad')
Amplitude.setUserProperties(
  'device_id',
  'app_version',
  'platform',
  'os_name',
  'os_version',
  'device_brand',
  'device_manufacturer',
  'device_model',
  'carrier',
  'country',
  'city',
  'dma',
  'adid',
  'idfa',
  'ip_address',
)
class App extends Component {
  render() {
    return (
      <View style={styles.container}>
        <FlatList
          keyExtractor={pokemon => pokemon.number}
          data={pokemon}
          renderItem={({ item }) => <Text>{item.name}</Text>}
        />
      </View>
    );
  }
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 50,
    padding: 50
  },
});
export default App;
